import { hotels } from "./data";
import Afficher from "./Afficher";
export default function Q2(){
    return hotels.filter(function (hot){
        return hot.chambers===50
    }).map(function(hotel,i){
        return <Afficher hotel={hotel} key={i}/>
    })
}
